import React from 'react';
import { IonTabBar, IonTabs} from '@ionic/react';

import BluetoothScan from "./bluetooth/index"

//import wifiScan from "./bluetooth/wifi" //uncomment with wifi implementation

class Main extends React.Component {
  render() {
    return (
      <IonTabs>
        <IonTabBar slot="bottom">
          <IonTabButton tab="account">
            <IonIcon icon={person} />
          </IonTabButton>
          <IonTabButton tab="contact">
            <IonIcon icon={call} />
          </IonTabButton>
          <IonTabButton tab="settings">
            <IonIcon icon={settings} />
          </IonTabButton>
        </IonTabBar>
      </IonTabs>
    )
  }
}

export default Main;
